            value:
              'At Photon, our vision is to preserve the planet\u2019s waterways and oceans through the adoption of electric propulsion technology. When compared to boats powered by internal combustion engines, we estimate that our product will reduce the total cost of ownership by almost half, require less maintenance without sacrificing performance while eliminating the use of fossil fuels. This is a clear and ripe opportunity for technical innovation that\u2019s good for people, planet, and profit. We are developing an electric outboard motor system and integrated fleet management software platform to provide an alternative propulsion system for small boat vessels. The system includes a first in-class electric motor (300 HP, 63 kWh battery) and software capable of providing predictive maintenance, optimized operator profiles, fleet management, telemetry, and eventually, semi-autonomous functions. The software platform will also enable our revenue model, a lease optimized to actual use. We will initially target tourism and transportation fleets including businesses such as whale watching, scuba and snorkel, boat rentals, charter fishing, and water taxis. We have developed a blueprint for how to bring key stakeholders to the table, including small businesses, utility companies, governmental and regulatory organizations, marinas, and charging infrastructure partners. This blueprint is currently being built for the state of Oregon and will be replicated in our target markets.',
